use PressGangCCMS;

create table if not exists `RS_ENDPOINT` (`ENDPOINT_ID` bigint auto_increment not null, `ENDPOINT_METHOD` varchar(255), `ENDPOINT_URL` varchar(255) not null, `URL_REGEX` boolean not null, primary key (`ENDPOINT_ID`), unique (`ENDPOINT_URL`, `ENDPOINT_METHOD`)) engine=InnoDB default charset=utf8;

create table if not exists `RS_SCOPE` (`SCOPE_ID` bigint auto_increment not null, `SCOPE_NAME` varchar(255) not null, primary key (`SCOPE_ID`), unique (`SCOPE_NAME`)) engine=InnoDB default charset=utf8;

create table if not exists `RS_SCOPE_RS_ENDPOINT` (`SCOPE_ID` bigint not null, `ENDPOINT_ID` bigint not null, primary key (`SCOPE_ID`, `ENDPOINT_ID`)) engine=InnoDB default charset=utf8;









































alter table `RS_SCOPE_RS_ENDPOINT` add constraint `FK_RS_SCOPE_RS_ENDPOINT_SCOPE_ID` FOREIGN KEY (`SCOPE_ID`) REFERENCES `RS_SCOPE` (`SCOPE_ID`), add constraint `FK_RS_SCOPE_RS_ENDPOINT_ENDPOINT_ID` FOREIGN KEY (`ENDPOINT_ID`) REFERENCES `RS_ENDPOINT` (`ENDPOINT_ID`);
